import React from 'react';
import styles from './Order.module.scss';

const Order = () => {
    return (
        <div className={styles.orderWrapper}>
            <div>
                <span>Заказчик:</span>
                <span>Timur Erkimbaiev</span>
            </div>
        </div>
    );
};

export default Order;
